import React from "react";

import './Navbar.css' 
const Navbar = () =>{
    return(
            <div className="navbar_background">
                <div className="navbar">
                    <div class="wrapper">
                        <div class="typing-demo">
                            Welcome to ...!
                        </div>
                    </div>  

                    <div className="navbar_menu">
                        <div className="navbar_login">SING IN</div>
                        
                    </div>
                </div>
            </div>
    )
}

export default Navbar;
